import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div class="barre">
        <br></br>
        <svg xmlns="http://www.w3.org/2000/svg" width="700" height="72" viewBox="0 0 700 72">
        <div class = "texte">Lacanau - qualité des eaux à la date du dd/mm/yyyy</div>
        </svg>
        <br></br>
      </div>
      </header>
    </div>
  );
}

export default App;
